While any type in Rust can be exposed as a GraphQL object, the most common one is a struct. There are two ways to create a GraphQL object in Juniper. If you've got a simple struct you want to expose, the easiest way is to use the custom derive attribute. The other way is described in the Complex fields chapter. #[derive(juniper::GraphQLObject)]
struct Person { name: String, age: i32,
} # fn main() {} This will create a GraphQL object type called Person , with two fields: name of type String! , and age of type Int! . Because of Rust's type system, everything is exported as non-null by default. If you need a nullable field, you can use Option<T> . We should take advantage of the fact that GraphQL is self-documenting and add descriptions to the type and fields. Juniper will automatically use associated doc comments as GraphQL descriptions: !FILENAME GraphQL descriptions via Rust doc comments #[derive(juniper::GraphQLObject)]
/// Information about a person
struct Person { /// The person's full name, including both first and last names name: String, /// The person's age in years, rounded down age: i32,
} # fn main() {} Objects and fields without doc comments can instead set a description via the graphql attribute. The following example is equivalent to the above: !FILENAME GraphQL descriptions via attribute #[derive(juniper::GraphQLObject)]
#[graphql(description="Information about a person")]
struct Person { #[graphql(description="The person's full name, including both first and last names")] name: String, #[graphql(description="The person's age in years, rounded down")] age: i32,
} # fn main() {} Descriptions set via the graphql attribute take precedence over Rust doc comments. This enables internal Rust documentation and external GraphQL documentation to differ: #[derive(juniper::GraphQLObject)]
#[graphql(description="This description shows up in GraphQL")]
/// This description shows up in RustDoc
struct Person { #[graphql(description="This description shows up in GraphQL")] /// This description shows up in RustDoc name: String, /// This description shows up in both RustDoc and GraphQL age: i32,
} # fn main() {}

