If you've got a struct that can't be mapped directly to GraphQL, that contains computed fields or circular structures, you have to use a more powerful tool: the object procedural macro. This macro lets you define GraphQL object fields in a Rust impl block for a type. Note that only GraphQL fields can be specified in this impl block. If you want to define normal methods on the struct, you have to do so in a separate, normal impl block. Continuing with the example from the last chapter, this is how you would define Person using the macro: struct Person { name: String, age: i32,
} #[juniper::graphql_object]
impl Person { fn name(&self) -> &str { self.name.as_str() } fn age(&self) -> i32 { self.age }
} // Note that this syntax generates an implementation of the GraphQLType trait,
// the base impl of your struct can still be written like usual:
impl Person { pub fn hidden_from_graphql(&self) { // [...] }
} # fn main() { } While this is a bit more verbose, it lets you write any kind of function in the field resolver. With this syntax, fields can also take arguments: #[derive(juniper::GraphQLObject)]
struct Person { name: String, age: i32,
} struct House { inhabitants: Vec<Person>,
} #[juniper::graphql_object]
impl House { // Creates the field inhabitantWithName(name), returning a nullable person fn inhabitant_with_name(&self, name: String) -> Option<&Person> { self.inhabitants.iter().find(|p| p.name == name) }
} # fn main() {} To access global data such as database connections or authentication information, a context is used. To learn more about this, see the next chapter: Using contexts .

